le=\"color: rgb(0, 0, 0); background-color: rgb(255, 255, 255);\">ÁΩëÁªúÂú∞ÂùÄÈ¢ÑËßà</span></h3><pre><code class=\"language-javascript\">&lt;script setup&gt;\nimport { ref } from \'vue\'\n\n//ÂºïÂÖ•VueOfficeDocxÁªÑ‰ª∂\nimport VueOfficeDocx from \'@vue-office/docx\'\n//ÂºïÂÖ•Áõ∏ÂÖ≥Ê†∑Âºè\nimport \'@vue-office/docx/lib/index.css\'\n\nconst docx = ref(\'http://static.shanhuxueyuan.com/test6.docx\')\n\nconst rendered = () =&gt; {\n  console.log(\"Ê∏≤ÊüìÂÆåÊàê\")\n}\n\nconst errorHandler = () =&gt; {\n  console.log(\'Ê∏≤ÊüìÂ§±Ë¥•\')\n}\n\n&lt;/script&gt;\n\n&lt;template&gt;\n  &lt;vue-office-docx :src=\"docx\" style=\"width: 100vw;\" @rendered=\"rendered\" @error=\"errorHandler\"/&gt;\n&lt;/template&gt;</code></pre><h3><span style=\"color: rgb(51, 51, 51); background-color: rgb(255, 255, 255);\">ËØªÂèñÊñá‰ª∂ArrayBuffer</span></h3><pre><code class=\"language-javascript\">&lt;script setup&gt;\nimport { ref } from \'vue\'\n//ÂºïÂÖ•VueOfficeDocxÁªÑ‰ª∂\nimport VueOfficeDocx from \'@vue-office/docx\'\n//ÂºïÂÖ•Áõ∏ÂÖ≥Ê†∑Âºè\nimport \'@vue-office/docx/lib/index.css\'\n\nconst docx = ref(\'\')\n\nconst rendered = () =&gt; {\n  console.log(\"Ê∏≤ÊüìÂÆåÊàê\")\n}\n\nconst errorHandler = () =&gt; {\n  console.log(\'Ê∏≤ÊüìÂ§±Ë¥•\')\n}\n\nconst changeHandle = (event) =&gt; {\n  let file = event.target.files[0]\n  let fileReader = new FileReader()\n  fileReader.readAsArrayBuffer(file)\n  fileReader.onload = () =&gt; {\n    docx.value = fileReader.result\n  }\n}\n&lt;/script&gt;\n\n&lt;template&gt;\n  &lt;input type=\"file\" @change=\"changeHandle\" /&gt;\n  &lt;vue-office-docx :src=\"docx\" style=\"width: 100vw;\" @rendered=\"rendered\" @error=\"errorHandler\"/&gt;\n&lt;/template&gt;</code></pre><h3>ÂÖ≥‰∫é@vue-office/excel„ÄÅ@vue-office/pdf</h3><pre><code class=\"language-javascript\">ÈÄöËøáÁΩëÁªúÂú∞ÂùÄÈ¢ÑËßàÁ§∫‰æãÂ¶Ç‰∏ãÔºåÈÄöËøáÊñá‰ª∂ArrayBufferÈ¢ÑËßàÂíå‰∏äÈù¢docxÁöÑ‰ΩøÁî®ÊñπÂºè‰∏ÄËá¥„ÄÇ\n&lt;script&gt;\n//ÂºïÂÖ•VueOfficeExcelÁªÑ‰ª∂\nimport VueOfficeExcel from \'@vue-office/excel\'\n//Á§